import{_ as e,c as a,o as s,d as l}from"./app.4b9a283d.js";const f=JSON.parse('{"title":"《现代Web布局》其五：grid 定位、计算及对齐","description":"","frontmatter":{"title":"《现代Web布局》其五：grid 定位、计算及对齐","icon":"css","isOriginal":true,"date":"2023-01-06T00:00:00.000Z","category":["读书笔记","前端"],"tag":["css","前端"],"image":"","banner":""},"headers":[{"level":2,"title":"参考内容","slug":"参考内容","link":"#参考内容","children":[]},{"level":2,"title":"自动定位 和 grid-auto-flow","slug":"自动定位-和-grid-auto-flow","link":"#自动定位-和-grid-auto-flow","children":[{"level":3,"title":"按行和按列","slug":"按行和按列","link":"#按行和按列","children":[]},{"level":3,"title":"dense (密集) 和 sparse (稀疏)","slug":"dense-密集-和-sparse-稀疏","link":"#dense-密集-和-sparse-稀疏","children":[]},{"level":3,"title":"自动定位的具体流程","slug":"自动定位的具体流程","link":"#自动定位的具体流程","children":[]}]},{"level":2,"title":"Grid 轨道尺寸计算","slug":"grid-轨道尺寸计算","link":"#grid-轨道尺寸计算","children":[{"level":3,"title":"百分比","slug":"百分比","link":"#百分比","children":[]},{"level":3,"title":"fr","slug":"fr","link":"#fr","children":[]},{"level":3,"title":"子元素 margin","slug":"子元素-margin","link":"#子元素-margin","children":[]}]},{"level":2,"title":"究极简写","slug":"究极简写","link":"#究极简写","children":[{"level":3,"title":"grid-template","slug":"grid-template","link":"#grid-template","children":[]},{"level":3,"title":"grid","slug":"grid","link":"#grid","children":[]}]},{"level":2,"title":"对齐","slug":"对齐","link":"#对齐","children":[{"level":3,"title":"内联轴和块轴","slug":"内联轴和块轴","link":"#内联轴和块轴","children":[]},{"level":3,"title":"子元素对齐","slug":"子元素对齐","link":"#子元素对齐","children":[]},{"level":3,"title":"轨道对齐","slug":"轨道对齐","link":"#轨道对齐","children":[]}]}],"relativePath":"posts/tech/《现代Web布局》其五：grid 定位、计算及对齐.md","lastUpdated":1678177559000}'),r={name:"posts/tech/《现代Web布局》其五：grid 定位、计算及对齐.md"},o=l(`<p>包含 <code>grid</code> 布局的：</p><ul><li>自动定位</li><li>轨道尺寸计算</li><li>属性简写</li><li>对齐属性</li></ul><h2 id="参考内容" tabindex="-1">参考内容 <a class="header-anchor" href="#参考内容" aria-hidden="true">#</a></h2><p><a href="https://juejin.cn/book/7161370789680250917/section/7161623971073359902" target="_blank" rel="noreferrer">稀土掘金——现代Web布局，定义一个网格布局</a></p><p><a href="https://juejin.cn/book/7161370789680250917/section/7161624007702216735" target="_blank" rel="noreferrer">稀土掘金——现代Web布局，Grid布局的计算</a></p><p><a href="https://juejin.cn/book/7161370789680250917/section/7161623932439625758" target="_blank" rel="noreferrer">稀土掘金——现代Web布局，网格项目的放置和层叠</a></p><p><a href="https://developer.mozilla.org/zh-CN/docs/Web/CSS/CSS_Grid_Layout/Grid_Template_Areas" target="_blank" rel="noreferrer">MDN——网格模板区域</a></p><p><a href="https://developer.mozilla.org/zh-CN/docs/Web/CSS/CSS_Grid_Layout/Auto-placement_in_CSS_Grid_Layout" target="_blank" rel="noreferrer">MDN——CSS网格布局中的自动定位</a></p><p><a href="https://developer.mozilla.org/zh-CN/docs/Web/CSS/grid-template" target="_blank" rel="noreferrer">MDN——grid-template</a></p><p><a href="https://developer.mozilla.org/zh-CN/docs/Web/CSS/grid-auto-flow" target="_blank" rel="noreferrer">MDN——grid-auto-flow</a></p><h2 id="自动定位-和-grid-auto-flow" tabindex="-1">自动定位 和 <code>grid-auto-flow</code> <a class="header-anchor" href="#自动定位-和-grid-auto-flow" aria-hidden="true">#</a></h2><p><code>grid</code> 子元素，可以用属性将它定义到容器中的某个区域。</p><p>但如果不使用属性定位，它也会自动填充进区域中。</p><p>填充原则：<strong>依次填充每一行，必要时添加新行（隐式轨道）。</strong></p><p>我们可以使用 <code>grid-auto-flow</code> 来控制流的方向。</p><h3 id="按行和按列" tabindex="-1">按行和按列 <a class="header-anchor" href="#按行和按列" aria-hidden="true">#</a></h3><p><img src="https://s2.loli.net/2023/01/06/JszU6aY2dVP1IMC.jpg" alt="grid-auto-flow-1"></p><ul><li><code>grid-auto-flow: row</code>：自动填充行，必要时添加行</li><li><code>grid-auto-flow: columns</code>：自动填充列，必要时添加列</li></ul><h3 id="dense-密集-和-sparse-稀疏" tabindex="-1"><code>dense</code> (密集) 和 <code>sparse</code> (稀疏) <a class="header-anchor" href="#dense-密集-和-sparse-稀疏" aria-hidden="true">#</a></h3><p><img src="https://s2.loli.net/2023/01/06/EKFXBpZ86PvJ9gk.jpg" alt="dense"></p><p>子元素有时会占据多个单元格，这可能会导致留出空隙。</p><p><code>sparse</code>(默认值) 属性，会无视空隙继续往后面自动定位元素。</p><p>而 <code>dense</code> 属性，能让后来的元素尝试去填补之前留下的空隙。（但同时也可能导致原来出现的次序被打乱）</p><blockquote><p><code>dense</code> <code>sparse</code> 可以与 <code>row</code> <code>column</code> 同时使用：</p><div class="language-css"><button title="Copy Code" class="copy"></button><span class="lang">css</span><pre class="shiki material-theme-palenight" tabindex="0"><code><span class="line"><span style="color:#89DDFF;">.</span><span style="color:#FFCB6B;">demo</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">{</span></span>
<span class="line"><span style="color:#A6ACCD;">  </span><span style="color:#B2CCD6;">grid-auto-flow</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> row dense</span><span style="color:#89DDFF;">;</span></span>
<span class="line"><span style="color:#89DDFF;">}</span></span>
<span class="line"></span></code></pre></div></blockquote><h4 id="dense-的适用场景" tabindex="-1"><code>dense</code> 的适用场景 <a class="header-anchor" href="#dense-的适用场景" aria-hidden="true">#</a></h4><p>适用于所有对顺序无所谓，但是需要紧密排列的布局。比如：照片墙。</p><p><img src="https://s2.loli.net/2023/01/10/SA9DCqvxFc1GTsM.png" alt="照片墙"></p><div class="language-css"><button title="Copy Code" class="copy"></button><span class="lang">css</span><pre class="shiki material-theme-palenight" tabindex="0"><code><span class="line"><span style="color:#89DDFF;">.</span><span style="color:#FFCB6B;">wrapper</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">{</span></span>
<span class="line"><span style="color:#A6ACCD;">  </span><span style="color:#B2CCD6;">grid-auto-flow</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> row dense</span><span style="color:#89DDFF;">;</span></span>
<span class="line"><span style="color:#89DDFF;">}</span></span>
<span class="line"><span style="color:#89DDFF;">.</span><span style="color:#FFCB6B;">single</span><span style="color:#89DDFF;">:</span><span style="color:#C792EA;">nth-child</span><span style="color:#89DDFF;">(</span><span style="color:#F78C6C;">5n+1</span><span style="color:#89DDFF;">)</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">{</span></span>
<span class="line"><span style="color:#A6ACCD;">  </span><span style="color:#B2CCD6;">grid-area</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> span </span><span style="color:#F78C6C;">2</span><span style="color:#A6ACCD;"> / span </span><span style="color:#F78C6C;">2</span><span style="color:#89DDFF;">;</span></span>
<span class="line"><span style="color:#89DDFF;">}</span></span>
<span class="line"><span style="color:#89DDFF;">.</span><span style="color:#FFCB6B;">single</span><span style="color:#89DDFF;">:</span><span style="color:#C792EA;">nth-child</span><span style="color:#89DDFF;">(</span><span style="color:#F78C6C;">7n+1</span><span style="color:#89DDFF;">)</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">{</span></span>
<span class="line"><span style="color:#A6ACCD;">  </span><span style="color:#B2CCD6;">grid-row</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> span </span><span style="color:#F78C6C;">2</span><span style="color:#89DDFF;">;</span></span>
<span class="line"><span style="color:#89DDFF;">}</span></span>
<span class="line"><span style="color:#89DDFF;">.</span><span style="color:#FFCB6B;">single</span><span style="color:#89DDFF;">:</span><span style="color:#C792EA;">nth-child</span><span style="color:#89DDFF;">(</span><span style="color:#F78C6C;">9n+1</span><span style="color:#89DDFF;">)</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">{</span></span>
<span class="line"><span style="color:#A6ACCD;">  </span><span style="color:#B2CCD6;">grid-column</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> span </span><span style="color:#F78C6C;">2</span><span style="color:#89DDFF;">;</span></span>
<span class="line"><span style="color:#89DDFF;">}</span></span>
<span class="line"></span></code></pre></div><h4 id="sparse-的适用场景" tabindex="-1"><code>sparse</code> 的适用场景 <a class="header-anchor" href="#sparse-的适用场景" aria-hidden="true">#</a></h4><p>一个妙用，可以布局有逻辑顺序的页面元素。</p><p><img src="https://s2.loli.net/2023/01/10/N5VdsceTqHpryaY.jpg" alt="sparse"></p><div class="language-css"><button title="Copy Code" class="copy"></button><span class="lang">css</span><pre class="shiki material-theme-palenight" tabindex="0"><code><span class="line"><span style="color:#FFCB6B;">dl</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">{</span></span>
<span class="line"><span style="color:#A6ACCD;">  </span><span style="color:#B2CCD6;">display</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> grid</span><span style="color:#89DDFF;">;</span></span>
<span class="line"><span style="color:#A6ACCD;">  </span><span style="color:#B2CCD6;">grid-column</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> auto </span><span style="color:#F78C6C;">1fr</span><span style="color:#89DDFF;">;</span></span>
<span class="line"><span style="color:#89DDFF;">}</span></span>
<span class="line"><span style="color:#FFCB6B;">dt</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">{</span></span>
<span class="line"><span style="color:#A6ACCD;">  </span><span style="color:#B2CCD6;">grid-column</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> </span><span style="color:#F78C6C;">1</span><span style="color:#89DDFF;">;</span></span>
<span class="line"><span style="color:#89DDFF;">}</span></span>
<span class="line"><span style="color:#FFCB6B;">dd</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">{</span></span>
<span class="line"><span style="color:#A6ACCD;">  </span><span style="color:#B2CCD6;">grid-column</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> </span><span style="color:#F78C6C;">2</span><span style="color:#89DDFF;">;</span></span>
<span class="line"><span style="color:#89DDFF;">}</span></span>
<span class="line"></span></code></pre></div><h3 id="自动定位的具体流程" tabindex="-1">自动定位的具体流程 <a class="header-anchor" href="#自动定位的具体流程" aria-hidden="true">#</a></h3><ol><li>对裸露的文本，生成匿名网格</li><li>先安置 <strong>定好了区域的子元素</strong>（定好四面八方的线，或使用命名区域）</li><li>插入仅定好行位置的子元素（考虑是否 dense）</li><li>确定隐式网格的列数</li><li>插入剩余的网格子元素（考虑是否 dense）</li></ol><h2 id="grid-轨道尺寸计算" tabindex="-1">Grid 轨道尺寸计算 <a class="header-anchor" href="#grid-轨道尺寸计算" aria-hidden="true">#</a></h2><h3 id="百分比" tabindex="-1">百分比 <a class="header-anchor" href="#百分比" aria-hidden="true">#</a></h3><p><img src="https://s2.loli.net/2023/01/10/uyQMwhfezksKGI3.jpg" alt="百分比的问题"></p><p>轨道尺寸百分比的取值，是相对于 <code>grid</code> 容器的宽度（或者说 <code>inline-size</code>）。</p><p>如果子元素百分比大于等于 100%，再加上 <code>gap</code> 的尺寸，就会溢出容器。</p><p>因此，<strong>切勿让所有网格轨道都取百分比值</strong>。</p><h3 id="fr" tabindex="-1"><code>fr</code> <a class="header-anchor" href="#fr" aria-hidden="true">#</a></h3><p>又被称为 <strong>弹性网格轨道</strong>，也就是说，它 <strong>只能用于轨道尺寸</strong>。</p><h4 id="计算方式" tabindex="-1">计算方式 <a class="header-anchor" href="#计算方式" aria-hidden="true">#</a></h4><p><img src="https://s2.loli.net/2023/01/10/3VSC7bMLEl5BIqm.jpg" alt="fr计算1"></p><p>但是并非所有情况都会如上例这般理想。</p><h4 id="特殊情况-如果-fr-总数小于-1" tabindex="-1">特殊情况：如果 <code>fr</code> 总数小于 1 <a class="header-anchor" href="#特殊情况-如果-fr-总数小于-1" aria-hidden="true">#</a></h4><p><img src="https://s2.loli.net/2023/01/10/m3gwPSZH92rp8kh.jpg" alt="fr计算2"></p><p>当所有 <code>fr</code> 之和小于 1 时，表现类似于 <code>flex</code> 弹性布局。分配完后仍会有剩余空间。</p><h4 id="特殊情况-计算后的尺寸-小于-min-width" tabindex="-1">特殊情况：计算后的尺寸，小于 <code>min-width</code> <a class="header-anchor" href="#特殊情况-计算后的尺寸-小于-min-width" aria-hidden="true">#</a></h4><p><img src="https://s2.loli.net/2023/01/10/NFisMC2L3qUnT7l.jpg" alt="fr计算3"></p><p><strong>弹性宽度 会迁就 内部尺寸</strong>。</p><p>这可能导致子元素，没有计算得到你预想中的宽度。</p><p>想要消除 <code>min-width</code> 对弹性尺寸的影响，主要有两种方式：</p><ol><li><p><code>minmax(0, 1fr)</code></p><blockquote><p><code>1fr</code> 的底层实现逻辑其实就是 <code>minmax(auto, 1fr)</code>，意味着 <code>min=auto</code>（即 <code>min-width: min-content</code>）</p></blockquote><p>使用 <code>minmax(0, 1fr)</code> 来替代 <code>1fr</code>，将把最小值从默认的 <code>min-width</code> 重置为 <code>0</code>。</p></li><li><p><code>min-width: 0</code></p><p>与 <code>flex</code> 布局中类似，在子元素上设置 <code>min-width: 0</code> 来使 <code>min-content=0</code>。</p></li></ol><p>但是应该注意，取消 <code>min-content</code> 的影响后，可能会导致子元素内容溢出，需要额外处理。</p><h3 id="子元素-margin" tabindex="-1">子元素 <code>margin</code> <a class="header-anchor" href="#子元素-margin" aria-hidden="true">#</a></h3><p><img src="https://s2.loli.net/2023/01/10/LW1dVnDIFlC7S9s.jpg" alt="margin不会溢出"></p><p>子元素中设置 <code>margin</code> 并不会参与容器剩余空间的计算，设置的效果类似子元素 <code>padding</code>，不会溢出容器。</p><h2 id="究极简写" tabindex="-1">究极简写 <a class="header-anchor" href="#究极简写" aria-hidden="true">#</a></h2><p>用于设置 grid 布局的属性繁多，为啥不来点简写呢？</p><h3 id="grid-template" tabindex="-1"><code>grid-template</code> <a class="header-anchor" href="#grid-template" aria-hidden="true">#</a></h3><blockquote><p><a href="https://developer.mozilla.org/zh-CN/docs/Web/CSS/grid-template" target="_blank" rel="noreferrer"><code>grid-template</code></a> 属性可同时设置以下属性：</p><ul><li><a href="https://developer.mozilla.org/zh-CN/docs/Web/CSS/grid-template-rows" target="_blank" rel="noreferrer"><code>grid-template-rows</code></a></li><li><a href="https://developer.mozilla.org/zh-CN/docs/Web/CSS/grid-template-columns" target="_blank" rel="noreferrer"><code>grid-template-columns</code></a></li><li><a href="https://developer.mozilla.org/zh-CN/docs/Web/CSS/grid-template-areas" target="_blank" rel="noreferrer"><code>grid-template-areas</code></a></li></ul></blockquote><h4 id="第一种用法-同时设置行列轨道" tabindex="-1">第一种用法，同时设置行列轨道 <a class="header-anchor" href="#第一种用法-同时设置行列轨道" aria-hidden="true">#</a></h4><p><img src="https://s2.loli.net/2023/01/06/VULrG4qNEMCjdfR.jpg" alt="grid-template-1"></p><p>使用 <code>/</code> 分隔两串轨道列表，左边的代表 <code>grid-template-rows</code>，右边的代表 <code>grid-template-columns</code>。</p><h4 id="第二种用法-行轨道用-grid-areas-设置" tabindex="-1">第二种用法，行轨道用 <code>grid-areas</code> 设置 <a class="header-anchor" href="#第二种用法-行轨道用-grid-areas-设置" aria-hidden="true">#</a></h4><p><img src="https://s2.loli.net/2023/01/06/GHlfnriEON1IPtY.jpg" alt="grid-template-2"></p><p>相对用法一，<code>/</code> 右边一致，但左边更复杂了。</p><p>除了能使用 <code>grid-areas</code> 的“ASCII艺术方法”，还能设置行高（可选），以及给行首尾网格线命名（可选）。</p><h3 id="grid" tabindex="-1"><code>grid</code> <a class="header-anchor" href="#grid" aria-hidden="true">#</a></h3><blockquote><p><a href="https://developer.mozilla.org/zh-CN/docs/Web/CSS/grid" target="_blank" rel="noreferrer"><code>grid</code></a> 简写方式更进一步，它包含了与隐式轨道相关的属性，所以通过它可以同时设置以下属性：</p><ul><li><a href="https://developer.mozilla.org/zh-CN/docs/Web/CSS/grid-template-rows" target="_blank" rel="noreferrer"><code>grid-template-rows</code></a></li><li><a href="https://developer.mozilla.org/zh-CN/docs/Web/CSS/grid-template-columns" target="_blank" rel="noreferrer"><code>grid-template-columns</code></a></li><li><a href="https://developer.mozilla.org/zh-CN/docs/Web/CSS/grid-template-areas" target="_blank" rel="noreferrer"><code>grid-template-areas</code></a></li><li><a href="https://developer.mozilla.org/zh-CN/docs/Web/CSS/grid-auto-rows" target="_blank" rel="noreferrer"><code>grid-auto-rows</code></a></li><li><a href="https://developer.mozilla.org/zh-CN/docs/Web/CSS/grid-auto-columns" target="_blank" rel="noreferrer"><code>grid-auto-columns</code></a></li><li><a href="https://developer.mozilla.org/zh-CN/docs/Web/CSS/grid-auto-flow" target="_blank" rel="noreferrer"><code>grid-auto-flow</code></a></li></ul></blockquote><p>由于 <code>grid</code> 属性无法设置 <code>gap</code>，会将其设置默认值为 <code>0</code>。</p><h4 id="第一种用法-当成-grid-template-来用" tabindex="-1">第一种用法，当成 <code>grid-template</code> 来用 <a class="header-anchor" href="#第一种用法-当成-grid-template-来用" aria-hidden="true">#</a></h4><p><code>grid</code> 属性完全支持 <code>grid-template</code> 的用法，详见 <a href="#grid-template">上面</a>。</p><h4 id="第二种用法-设置行或列方向的隐式轨道" tabindex="-1">第二种用法，设置行或列方向的隐式轨道 <a class="header-anchor" href="#第二种用法-设置行或列方向的隐式轨道" aria-hidden="true">#</a></h4><p><img src="https://s2.loli.net/2023/01/11/yseHViNh8bKPSEo.jpg" alt="grid属性"></p><p><code>grid: 行属性 / 列属性</code></p><p>其中 行属性 和 列属性，支持两种写法：</p><ul><li>显式：即 <code>grid-template-[columns|rows]</code> 的属性值</li><li>隐式：<code>auto-flow dense(是否紧凑排布，可选) grid-auto-columns(隐式轨道尺寸，可选)</code></li></ul><h2 id="对齐" tabindex="-1">对齐 <a class="header-anchor" href="#对齐" aria-hidden="true">#</a></h2><h3 id="内联轴和块轴" tabindex="-1">内联轴和块轴 <a class="header-anchor" href="#内联轴和块轴" aria-hidden="true">#</a></h3><p><img src="https://s2.loli.net/2023/01/12/1RymqATNgMrIcKp.jpg" alt="Axis"></p><p><code>grid</code> 布局中内联轴和块轴，会受到 <code>writing-mode</code> 影响。</p><ul><li>内联轴：文字行文方向</li><li>块轴：文字换行方向</li></ul><h3 id="子元素对齐" tabindex="-1">子元素对齐 <a class="header-anchor" href="#子元素对齐" aria-hidden="true">#</a></h3><p>子元素在<strong>所处区域内对齐</strong>。</p><h4 id="块轴对齐" tabindex="-1">块轴对齐 <a class="header-anchor" href="#块轴对齐" aria-hidden="true">#</a></h4><p><img src="https://s2.loli.net/2023/01/12/sEv3d4AfakRoINp.jpg" alt="block-asix"></p><h4 id="内联轴对齐" tabindex="-1">内联轴对齐 <a class="header-anchor" href="#内联轴对齐" aria-hidden="true">#</a></h4><p><img src="https://s2.loli.net/2023/01/12/VzaZwmsfGqr9NCY.jpg" alt="inline-asix"></p><h4 id="子元素对齐简写" tabindex="-1">子元素对齐简写 <a class="header-anchor" href="#子元素对齐简写" aria-hidden="true">#</a></h4><p><a href="https://developer.mozilla.org/zh-CN/docs/Web/CSS/place-items" target="_blank" rel="noreferrer"><code>place-items</code></a> = <a href="https://developer.mozilla.org/zh-CN/docs/Web/CSS/align-items" target="_blank" rel="noreferrer"><code>align-items</code></a> + <a href="https://developer.mozilla.org/zh-CN/docs/Web/CSS/justify-items" target="_blank" rel="noreferrer"><code>justify-items</code></a></p><p><a href="https://developer.mozilla.org/zh-CN/docs/Web/CSS/place-self" target="_blank" rel="noreferrer"><code>place-self</code></a> = <a href="https://developer.mozilla.org/zh-CN/docs/Web/CSS/align-self" target="_blank" rel="noreferrer"><code>align-self</code></a> + <a href="https://developer.mozilla.org/zh-CN/docs/Web/CSS/justify-self" target="_blank" rel="noreferrer"><code>justify-self</code></a></p><h3 id="轨道对齐" tabindex="-1">轨道对齐 <a class="header-anchor" href="#轨道对齐" aria-hidden="true">#</a></h3><p>当块轴或内联轴上，容器尺寸 &gt; 所有轨道 &amp; 间距的尺寸，即可对轨道进行对齐。</p><h4 id="轨道块轴对齐" tabindex="-1">轨道块轴对齐 <a class="header-anchor" href="#轨道块轴对齐" aria-hidden="true">#</a></h4><p><img src="https://s2.loli.net/2023/01/12/ZkLwav46cThxS8y.jpg" alt="align-content"></p><h4 id="轨道内联轴对齐" tabindex="-1">轨道内联轴对齐 <a class="header-anchor" href="#轨道内联轴对齐" aria-hidden="true">#</a></h4><p><img src="https://s2.loli.net/2023/01/12/28sq3oxfFPIQtkL.jpg" alt="justify-content"></p><h4 id="轨道对齐简写" tabindex="-1">轨道对齐简写 <a class="header-anchor" href="#轨道对齐简写" aria-hidden="true">#</a></h4><p><a href="https://developer.mozilla.org/zh-CN/docs/Web/CSS/place-content" target="_blank" rel="noreferrer"><code>place-content</code></a> = <a href="https://developer.mozilla.org/zh-CN/docs/Web/CSS/align-content" target="_blank" rel="noreferrer"><code>align-content</code></a> + <a href="https://developer.mozilla.org/zh-CN/docs/Web/CSS/justify-content" target="_blank" rel="noreferrer"><code>justify-content</code></a></p><p><a href="https://developer.mozilla.org/zh-CN/docs/Web/CSS/place-content" target="_blank" rel="noreferrer"><code>place-content</code></a> = <a href="https://developer.mozilla.org/zh-CN/docs/Web/CSS/align-content" target="_blank" rel="noreferrer"><code>align-content</code></a> + <a href="https://developer.mozilla.org/zh-CN/docs/Web/CSS/justify-content" target="_blank" rel="noreferrer"><code>justify-content</code></a></p>`,102),n=[o];function t(p,d,c,i,h,g){return s(),a("div",null,n)}const m=e(r,[["render",t]]);export{f as __pageData,m as default};
